import Content from "./components/content/Content";
import Navigation from "./components/navigation/Navigation";
import Order from "./components/order/Order";
import ContactUs from "./js/emailSend";


function App() {
    return (
        <div className="App">
            <Header/>
            <Navigation/>
            <Order/>
            <ContactUs/>
            <Content/>
            <Footer/>
            <OrderCall/>
        </div>
    );
}

export default App;
